:- module(dcs_world_countries, [country_property/2]).

/** <module> Countries
 *
 */

:- multifile dcs:property_of_country/2.

country_property(Country, Property) :-
    country(Country, Property).
country_property(Country, Property) :-
    dcs:property_of_country(defined, Country),
    dcs:property_of_country(Property, Country).

dcs:property_of_country(defined, Country) :-
    country(Country, world_id(_)).

